import Vue from 'vue';
import VueProgressBar from 'vue-progressbar';
import Pagination from '@/components/pagination';
Vue.use(VueProgressBar, {
  color: '#7009FF',
  failedColor: '#1a11e8',
  thickness: '2px',
  transition: {
    speed: '0.3s',
    opacity: '0.6s',
    termination: 300
  },
  autoRevert: true,
  location: 'top',
  inverse: false
});
Vue.component('pagination', Pagination);
